import "./App.css";
import TaskList from "./components/TaskList";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <TaskList />
      </div>
    </BrowserRouter>
  );
}

export default App;
